import logo from './logo.svg';
import './App.css';

function App() {
  function NameInput() {
    return (
      <label className="header-name">
        <input placeholder="Untitled" />
      </label>
    );
  }

  class Form {
    render() {
      return (
        <div>
          <NameInput />
        </div>
      );
    }
  }
}

export default App;
